import React from 'react';
import {Switch,Route} from 'react-router-dom'
import Nav from './components/Navs'

import './App.css';

function App() {
  return( 
  <div>

  <Switch>
    <Route exact path="/">
         This is home page
    </Route>
    <Route exact path="/contacts">
      This is contacts page
    </Route>
    <Route >
      404 Not found
    </Route>

    </Switch>
    </div>
    );
}

export default App;
